    /* Reset */
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }
    
    body {
      font-family: Arial, sans-serif;
      background-color: #ffffff;
      color: #000000;
      transition: background-color 0.5s ease, color 0.5s ease;
    }
    
    body.dark {
      background-color: #222222;
      color: #ffffff;
    }
    
    /* Header Layout */
    .site-header {
      display: flex;
      align-items: center;
      justify-content: space-between;
      padding: 10px 20px;
      border-bottom: 1px solid #ccc;
    }
    
    /* Left: Logo + Title */
    .header-left {
      display: flex;
      align-items: center;
    }
    
    /* Placeholder SVG Logo */
    .logo {
      width: 50px;
      height: 50px;
      margin-right: 10px;
      transition: filter 0.5s ease;
      filter: invert(0); /* Light mode: logo remains as is (black) */
    }
    
    body.dark .logo {
      filter: invert(1); /* Dark mode: invert colors (black becomes white) */
    }
    
    .site-title {
      font-family: 'Libre Baskerville', serif;
      font-size: 1.8em;
      font-weight: 700;
    }
    
    /* Center: Navigation */
    .header-center nav ul {
      list-style: none;
      display: flex;
      gap: 20px;
    }
    
    .header-center nav ul li a {
      text-decoration: none;
      color: inherit;
      font-size: 1em;
      transition: color 0.3s ease;
    }
    
    .header-center nav ul li a:hover {
      color: #007BFF;
    }
    
    /* Right: Dark/Light Toggle */
    .toggle-btn {
      background: none;
      border: none;
      cursor: pointer;
      outline: none;
      padding: 5px;
      transition: transform 0.3s ease;
    }
    
    .toggle-btn:hover {
      transform: scale(1.1);
    }
    
    .toggle-btn svg {
      width: 24px;
      height: 24px;
      fill: currentColor;
      transition: fill 0.5s ease;
    }
    
    /* Show Moon icon by default (for light mode) */
    .icon-sun {
      display: none;
    }
    
    /* In dark mode, swap icons */
    body.dark .toggle-btn .icon-sun {
      display: inline-block;
    }
    
    body.dark .toggle-btn .icon-moon {
      display: none;
    }
    
    /* Responsive Adjustments */
    @media (max-width: 768px) {
      .header-center nav ul {
        gap: 10px;
      }
      .site-title {
        font-size: 1.5em;
      }
    }
  </style>
</head>
